import React, { Component } from "react";

class Header extends Component {
  constructor(props) {
    super(props);
    this.Header = Header.bind(this);
  }
  Header(){
       alert("Header home page");
  }
  render(){
   return (
        <div>
          {/*Header*/}
          {/*nav pill*/}
          <div id="header">
            <ul className="nav nav-pills justify-content-xl-end navbar-expand-lg navbar-light bg-light">
              <li className="nav-item">
                <a className="nav-link avtive" href="#home">TRANG CHỦ</a>
              </li>
              <li className="nav-item dropdown">
                <a className="nav-link dropdown-toggle" data-toggle="dropdown" href="#">THỊ TRƯỜNG</a>
                <div className="dropdown-menu">
                  <a className="dropdown-item" href="#">MUA TÔM</a>
                  <a className="dropdown-item" href="#">ĐẶT MUA TÔM</a>
                </div>
              </li>
              <li className="nav-item ">
                <a className="nav-link text-dark" href="#goback">VỀ CHÚNG TÔI</a>
              </li>
              <li className="nav-item ">
                <a className="nav-link text-dark" href="#sign-up">Đăng Nhập</a>
              </li>
              <li className="nav-item ">
                <a className="nav-link text-dark" href="#sign-in">Đăng kí</a>
              </li>
            </ul>
          </div>
          {/*end nav pill*/}

          {/*banner*/}
          <p className="banner" />
          {/*end banner*/}

          {/*Header*/}
        </div>
      );
    }
  };
  export default Header;
